function CaptainPicks() {
    return (
        <div id="captain-picks-container">
            <div id="captain-picks-title-container">
                <h4>Captain</h4>
                <h4>Picks</h4>
                <h4>GW1</h4>
            </div>
            <CaptainPick playername="Bruno Fernandes" team="MUN" opponent="Aston Villa (AVL)"/>
            <CaptainPick playername="Kevin de Bruyne" team="MCI" opponent="Newcastle (NEW)"/>
            <CaptainPick playername="Alexandre Lacazette" team="ARS" opponent="Everton (EVE)"/>
        </div>
    )
}

function CaptainPick(props) {
    return (
        <div className="captain-pick">
            <h5>{props.playername}</h5>
            <h5>{props.team}</h5>
            <p>Opponent: {props.opponent}</p>
        </div>
    )
}

export default CaptainPicks;
